import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Page1 from './adpage1'
import { Link } from 'react-router-dom';

function App() {
  return (

    <div>

    <Routes>
      <Route path="/adpage1" element={<Page1 />}/>
      <Link to="/adpage1">
        <button>Admin</button>
      </Link>
    </Routes>


    </div>

  );
}

export default App
